Creates a hook for method_definition , intercepting all incoming calls the game makes to it. ignore_jmp - Skips trying to follow the first jmp in the function. Defaults to false. Using pre_function and post_function, the behavior of these functions can be modified. NOTE: Some native methods may not be able to be hooked with this, e.g. if they are just a wrapper over the native function. Some additional work will need to be done from our end to make those work. pre_function and post_function looks like so: local function pre_function(args) -- args are modifiable -- args[1] = thread_context -- args[2] = "this"/object pointer -- rest of args are the actual parameters -- actual parameters start at args[2] in a static function -- Some native functions will have the object start at args[1] and rest at args[2] -- All args are void* and not auto-converted to their respective types. -- You will need to do things like sdk.to_managed_object(args[2]) -- or sdk.to_int64(args[3]) to get arguments to better interact with or read. -- OPTIONAL: Specify an sdk.PreHookResult -- e.g. -- return sdk.PreHookResult.SKIP_ORIGINAL -- prevents the original function from being called -- return sdk.PreHookResult.CALL_ORIGINAL -- calls the original function, same as not returning anything
end local function post_function(retval) -- return something else if you don't want the original return value -- NOTE: the post_function will still be called if SKIP_ORIGINAL is returned from the pre_function -- So, if your function expects something valid in return, keep that in mind, as retval will not be valid. -- Make sure to convert custom retvals to sdk.to_ptr(retval) return retval
end Example hook: local function on_pre_get_timescale(args)
end local function on_post_get_timescale(retval) -- Make the game run 5 times as fast instead -- TODO: Make it so casting return values like this is not necessary return sdk.float_to_ptr(5.0)
end sdk.hook(sdk.find_type_definition("via.Scene"):get_method("get_TimeScale"), on_pre_get_timescale, on_post_get_timescale)

